}

div#supermenu ul li a{
background-color:#444 !important;
border:2px solid #666 !important;
-moz-border-radius:5px !important;
}

div#menu {
color:#000 !important;
-moz-border-radius:5px;
background-color:#515151 !important;
}

div.col2 div.container {
background-color:#000 !important; 
color:#000 !important;
border-top:1px #666 solid !important;
border-left:1px #666 solid !important;

background-image: url('data:image/png;base64,') !important;
background-repeat:repeat-x;
}

div.col2 div.container a{
color:#fff !important;
}

div.col2 div.container{
color:#ccc !important;
-moz-border-radius:5px;
}


div.content, div#searchBy, div#invite {
background-color:#000 !important; 
color:#aaa !important;
border-top:1px #666 solid !important;
border-left:1px #666 solid !important;
border-bottom:1px #333 solid !important;
border-right:1px #333 solid !important;
background-image: url('data:image/png;base64,') !important;
background-repeat:repeat-x;
}



.__noscriptPlaceholder__1, .__noscriptPlBaceholder__2{
display:none !important;
}

div.block {
background:none !important;
}

legend {
color:#666 !important;
}

div.title {
border-bottom:1px #666 solid;
}

span.label, div.pagination div.pages span.numbers {
background:none !important;
}

input, textarea#message, select, span#selection, div#selection {
background:#000 !important;
border:1px #666 solid !important;
color:#fff !important;
-moz-border-radius:5px;
}

input.default {
background:#000 !important;
border:1px #666 solid !important;
}

div#mediaBox {
border:0px !important;
}

div.content div div.actions ul li{
display:none !important;
}

div.highlight div.content{
background-color:#515151 !important;
background-image: url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAjCAYAAABVcWC0AAAAAXNSR0IArs4c6QAAAAZiS0dEAEEAQQBB7FNcdwAAAAlwSFlzAAALEwAACxMBAJqcGAAAAAd0SU1FB9kKDQQ3FbvsyzgAAAAZdEVYdENvbW1lbnQAQ3JlYXRlZCB3aXRoIEdJTVBXgQ4XAAAANklEQVQI143KQQoAIRADwU7CXOb//9WLoMiyeCnSELp7uKp4IcmJ7ZMkGFgJYEk/XJedX0sSEz1vAjppo6W4AAAAAElFTkSuQmCC') !important;
background-repeat:repeat-x;
}

div.col2 div.container div.body {
padding-left:2px !important;
}

div.favorites div.icon img, div.miniuser img {
height:150px !important;
width:150px !important;
}

div.favorites div.icon, div.miniuser {
height:150px !important;
width:150px !important;
}

#slot300x250 {
background-color:#000 !important;
}

div#trackPop {
display:none !important;
}


a[href="/welcome/findDJs"], #inviteLink2 { 
color:#000 !important;
}

#searchResultsTable td {
background-color:#000 !important;
color:#333 !important;
border:1px #000 solid !important;
}

#settings, div.menu ul, div.menu ul li{
background-color:#000 !important;
color:#333 !important;
}

div#popup {
background:#000 !important;
}

div.icon, img.profilePic {
border:0px !important;
padding:0px !important;
background-color:#000 !important;
}

div#noblips {
background-color:#000 !important;
}

a.buy {
display:none;
}

div.date a{
border:0px !important;
}

div.end {
border:0px !important;
}
div.title {
color:#fff !important;
}

div.blipsWrapper {
border-top:1px #666 solid !important;
border-left:1px #666 solid !important;
border-bottom:1px #333 solid !important;
border-right:1px #333 solid !important;
background-color:#000 !important;
}

div.title{
background-color:#000 !important;
background-image: url('data:image/png;base64,') !important;
}

div#mediaBox {
background-color:#000 !important;
}

#identitymenu { 
margin:0px 0 0 0 !important;
}

#whoami{
background: url('data:image/png;base64,') !important;
}

#identitymenu {
-moz-border-radius:2px;
background-color:#555 !important;
}

#identitymenu div.endcap {
background: url('data:image/png;base64,') no-repeat scroll right top !important;
}

div.paging {
background-image: url('data:image/png;base64,') !important;
}

div.pagingBottom {
background: url('data:image/png;base64,') 0 -26px !important;
}

#menu {
background: url('data:image/png;base64,') no-repeat scroll right top !important;
border-top:#ccc !important;
}

#menu div.secondary {
background: url('data:image/png;base64,') repeat-x scroll !important;
}

#menu div.primary ul li.endcap {
background: url('data:image/png;base64,') no-repeat scroll -292px 0 !important;
}


}
